import React, { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap-icons/font/bootstrap-icons.css';
import 'bootstrap/dist/js/bootstrap.min.js';
import '@fortawesome/fontawesome-free/css/all.min.css';

const Navbar = ({ darkMode, onNavItemClick }) => {
    const handleItemClick = (item) => {
        onNavItemClick(item);
      }

  return (
    <>
        <ul className="navbar-nav me-auto mb-2 mb-lg-0">
            <li className="nav-item">
                <a className={`nav-link active`} onClick={() => handleItemClick('Home')} style={{ cursor: 'pointer' }}>
                    <i className={`fas fa-home`} style={{ marginRight: '5px' }}></i>
                    <span>Home</span>
                </a>
            </li>
            <li className="nav-item">
                <a className={`nav-link`} onClick={() => handleItemClick('Talleres')} style={{ cursor: 'pointer' }}>
                    <i className={`fas fa-wrench`} style={{ marginRight: '5px' }}></i>
                    <span>Talleres</span>
                </a>
            </li>
        </ul>
    </>
  );
};

export default Navbar;
